\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“The thing that makes Michael who he is,” he said, “is his focus. His ability to concentrate absolutely. To set everything else aside other than what needs to be done right now.”\n\nApril 28, 2019\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt is a mistake to look too far ahead. Only one link in the chain of destiny can be handled at a time. —Winston Churchill\n\nApril 28, 2019\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cconcentration. When I coached, I’d say to the players, “Yes, I know you played hard, but that’s not good enough. You’ve got to stay focused on the task at hand the entire game.” —Rick Barry\n\nApril 28, 2019\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJordan had no tolerance for lapses—from teammates, from coaches, from anyone. He understood the detriment, even the danger, of divided focus.\n\nApril 28, 2019\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you chase two rabbits, both will escape. —Ancient Proverb\n\nApril 28, 2019\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe truth is, focus begins with recognition. Of where you are. Of what can be controlled. Of the moments in which we live, and the moments that we can affect. It begins with today. That’s what author Barbara Sher meant when she wrote. “Now is the operative word. Everything you put in your way is just another method of putting off the hour when you could actually be doing your dream. You don’t need endless time and perfect conditions. Do it now. Do it today. Do it for twenty minutes and watch your heart start beating!”\n\nApril 28, 2019\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“When I did lose the appetite to prove myself again and again,” Michael said, “I started tricking myself. I had to create situations to stay on top.”\n\nApril 28, 2019\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBaseball, it would seem, was a failure. Jordan never progressed past the Double-A level with the Chicago White Sox. He struggled to hit professional pitching. He barely managed to keep his average above the . 200 level in 1994. This was an athlete we were not accustomed to seeing fail, and being at the peak of his fame, in the wake of winning three NBA championships, it only meant the risk he took was that much bigger.\n\nApril 28, 2019\n\u001c35\n\u0011\n\u0011\n\n\nTWO: THE JOY\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe turn to leaders because they press us into action, because they make us feel that what we’re doing is healthy and intriguing and challenging. As long as that feeling is authentic, as long as it is not hidden from view, we can inspire entire groups.\n\nApril 28, 2019\n\u001c57\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMJ brought out the fire in everyone around him. He never missed a practice, no matter how many minutes he played the night before, no matter how many points he scored. That attitude, that pattern, spread to the rest of us. —Scott Burrell NBA PLAYER\n\nApril 28, 2019\n\u001c57\n\u0011\n\u0011\n\n\nTHREE: THE HARD WAY\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMichael once observed, “I have always approached practice as a kind of proving ground, especially with rookies. They might have seen me on television, read about me . . . and might think they know what I’m all about. . . . I want them to know it isn’t gossip or rumors. I want them to know it all comes from hard work. Every time I stepped on the court, even though I was on top of the world, I felt like I had something to prove.”\n\nApril 28, 2019\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“We fight human nature in this business,” said NBA assistant coach Jim Boylen. “It’s the ‘Get-By’ Theory: most guys will work just as hard as they must in order to achieve success. Michael fought human nature. Despite his success, he never got comfortable or satisfied. He always needed more.”\n\nApril 28, 2019\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Great players never look in the mirror and think, ‘I’m a great basketball player,” ’ Jordan said. “You ask yourself, ‘Am I the best player I can be?”’\n\nApril 28, 2019\n\u001c69\n\u0011\n\u0011\n\n\nFOUR: THE FIGHT\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOur culture is engrossed with the path of other people’s lives, with the contours of their disappointments, their achievements, the moments that shaped them into the people they became. And there’s something startlingly similar about these biographies, one common theme, one shared image. There is always a moment in every one in which our hero could have quit, could have abandoned his passion, his drive, his yearning, and meandered on to something else.\n\nApril 29, 2019\n\u001c79\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1qijm4G9nPSrzurLjgm3bIzlDG6c1bIJm-0B3uu0","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1E3Y