able franchises— even without Jordan— because Jordan felt an obligation to nurture the team that drafted him. “Part of the responsibility which went with your contract was to turn that team around and make it a winner— in fact, make it a champion,” said former Celtics coach Chris Ford. “That was an obligation, and it was deeply felt. I’m afraid not a lot of people feel that way today.”\n\nMay 3, 2019\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAerobic guru Dr. Ken Cooper makes it very simple: If you walk two miles in thirty minutes three times a week, or two miles in forty minutes five times a week, you will have a 58 percent reduction in death by heart attack, stroke or\n\nMay 3, 2019\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne day during the 1997–98 season, Phil Jackson called off a practice. Michael said to Scottie Pippen, “We’re not playing well enough not to practice.” So they went to Phil and requested a practice. Turned out they practiced for three hours. Later, MJ said, “The best players have to be the caretakers.”\n\nMay 3, 2019\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOld men are always advising young men to save money. That is bad advice. Don’t save every nickel. Invest in yourself. I never saved a dollar until I was forty years old. —Henry Ford\n\nMay 3, 2019\n\u001c98\n\u0011\n\u0011"}  }'


